cdt_name:
  - cos7
cdt_arch:
  - armv7l
channel_sources:
  - conda-forge
channel_targets:
  - conda-forge main
cross_target_platform:
  - linux-armv7l
rust_arch:
  - armv7-unknown-linux-gnueabihf
rust_arch_env:
  - ARMV7_UNKNOWN_LINUX_GNUEABIHF
rust_arch_env_build:
  - X86_64_UNKNOWN_LINUX_GNU
rust_default_cc:
  - armv7l-conda-linux-gnueabihf-cc
rust_default_cc_build:
  - x86_64-conda-linux-gnu-cc
MACOSX_DEPLOYMENT_TARGET:
  - '0'
MACOSX_SDK_VERSION:
  - '0'
target_platform:
  - linux-64
version:
  - 1.69.0
channel_sources:
  - conda-forge
channel_targets:
  - conda-forge main
zip_keys:
  - - cross_target_platform
    - rust_arch
    - rust_arch_env
    - rust_default_cc
    - MACOSX_SDK_VERSION
    - MACOSX_DEPLOYMENT_TARGET
  - - channel_sources
    - channel_targets
    - version
